import React from 'react'
import './Popup.css'

export default function Popup({open, onClose}) {
    if(!open) return null
  return (
    <div className='overlay1'>
        <div className='container1'>
              <div>Modal</div>
              <div className='close' onClick={onClose}>X</div>
        </div>    
    </div>
  ) 
}
